import * as React from "react";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import { IStudent } from "../../utils/types";
import { Button } from "@mui/material";
import { useAppSelector } from "../../store/hooks";

interface Student {
	students: IStudent[];
}

const ButtonActions = () => {
	return (
		<>
			<Button variant="contained" color="warning">
				Edit
			</Button>
			<Button variant="contained" color="error">
				Delete
			</Button>
		</>
	);
};

const TabularComponent = () => {
	const { fetchStudentsState } = useAppSelector((state) => state.student);
	const { students, isloading, errors } = fetchStudentsState;

	return (
		<TableContainer component={Paper}>
			<Table sx={{ minWidth: 650 }} aria-label="simple table">
				<TableHead>
					<TableRow>
						<TableCell>First Name</TableCell>
						<TableCell align="right">Last Name</TableCell>
						<TableCell align="right">Email</TableCell>
						<TableCell align="right">Actions</TableCell>
					</TableRow>
				</TableHead>
				<TableBody>
					{students.map((row, index) => (
						<TableRow
							key={index}
							sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
						>
							<TableCell component="th" scope="row">
								{row.first_name}
							</TableCell>
							<TableCell component="th" scope="row">
								{row.last_name}
							</TableCell>
							<TableCell align="right">{row.email}</TableCell>
							<TableCell align="right">{<ButtonActions />}</TableCell>
						</TableRow>
					))}
				</TableBody>
			</Table>
		</TableContainer>
	);
};

export default TabularComponent;
